import React from 'react';
import Header from './components/Header';
import Footer from './components/Footer';
import Board from './components/Board';
import Division from './components/Division';

const BoardPage = () => {
    return (
        <>
        <Header />
        <br></br>
        <br></br>
        <ul>
            <li>
                <Division />
            </li>
        </ul>
        <ul>
            <li>
            <Division />
            </li>
        </ul>
        <ul>
            <li>
            <Division />
            </li>
        </ul>
        
        <br></br>
        <Board />
        <br></br>
        <br></br>
        <Footer />
        </>
    );
};

export default BoardPage;
